import React from "react";
import {
  Container,
  Text,
  PrimaryButton,
  SearchInput
} from "../../styledComponents";
import styled from "styled-components";
import HouseItem from "../HouseItem";
const SearchWrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  /* justify-content: space-between; */
  padding: 30px 110px;
  background-color: white;
`;
const Wrapper = styled(Container)`
  display: flex;

  flex-wrap: wrap;
  flex-direction: row;
  justify-content: space-between;
  width: 100%;
  padding: 30px 110px;
`;
const Houses = () => {
  return (
    <Container flex={1}>
      <SearchWrapper>
        <Container flex={1} color="transparent">
          <SearchInput
            placeholder="What house are you looking for?"
            customStyles={{ width: "70%" }}
          />
        </Container>

        <PrimaryButton customStyles={{ width: 150, fontSize: 18 }}>
          Search
        </PrimaryButton>
      </SearchWrapper>
      <Wrapper>
        {[
          { id: 1, name: "Barcelona",location:'Kigali' },
          { id: 2, name: "Paris" },
          { id: 3, name: "Berlin" },
          { id: 4, name: "Barcelona" },
          { id: 5, name: "Paris" },
          { id: 6, name: "Berlin" }
        ].map(house => {
          return <HouseItem key={house.id} />;
        })}
      </Wrapper>
    </Container>
  );
};

export default Houses;
